/* Function  structure for function  `getParentMenuIds` */

/*!50003 DROP FUNCTION IF EXISTS `getParentMenuIds` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getParentMenuIds`(childId VARCHAR(50)) RETURNS varchar(1000) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempPar VARCHAR(1000);
    SET sTemp = '';
    SET sTempPar =childId;
    WHILE sTempPar IS NOT NULL DO
        IF sTempPar != childId THEN
            IF sTemp = '' THEN
                SET sTemp = CONCAT('',sTempPar);
            ELSE
                SET sTemp = CONCAT(sTemp,',',sTempPar);
            END IF;
        END IF;
        SELECT GROUP_CONCAT(parent_id) INTO sTempPar FROM sys_permission WHERE parent_id<>id AND FIND_IN_SET(id,sTempPar)>0;
    END WHILE;
    RETURN ReverseWordBy(sTemp,',');
END */$$
DELIMITER ;

/* Function  structure for function  `getParentOrgIds` */

/*!50003 DROP FUNCTION IF EXISTS `getParentOrgIds` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `getParentOrgIds`(childId VARCHAR(50)) RETURNS varchar(1000) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
BEGIN
    DECLARE sTemp VARCHAR(1000);
    DECLARE sTempPar VARCHAR(1000);
    SET sTemp = '';
    SET sTempPar =childId;
    WHILE sTempPar IS NOT NULL DO
        IF sTempPar != childId THEN
            IF sTemp = '' THEN
                SET sTemp = CONCAT('',sTempPar);
            ELSE
                SET sTemp = CONCAT(sTemp,',',sTempPar);
            END IF;
        END IF;
        SELECT GROUP_CONCAT(parent_id) INTO sTempPar FROM sys_organization WHERE parent_id<>id AND FIND_IN_SET(id,sTempPar)>0;
    END WHILE;
    RETURN ReverseWordBy(sTemp,',');
END */$$
DELIMITER ;

/* Function  structure for function  `ReverseWordBy` */

/*!50003 DROP FUNCTION IF EXISTS `ReverseWordBy` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `ReverseWordBy`(pOldVal TINYTEXT,  pDivChar  CHAR(1)) RETURNS tinytext CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci
BEGIN
  /** 预期结果.  **/
  DECLARE vResult TINYTEXT;
  -- 当前逗号的位置. 
  DECLARE vIndex INT;
  -- 前一个逗号的位置. 
  DECLARE vPrevIndex INT;
 
  -- 查询第一个 逗号的位置.
  SET vIndex = INSTR(pOldVal, pDivChar);
   
  IF vIndex = 0 THEN
    -- 参数中没有逗号，直接返回.
    RETURN pOldVal;
  END IF;
 
  -- 初始化情况，前一个逗号不存在.
  SET vPrevIndex = 0;
  -- 初始化结果为空白字符.
  SET vResult = '';
   
  -- 循环处理。
  WHILE vIndex > 0 DO
    -- 设置结果 = 本次查询的结果 ,  以前的查询结果.
    SET vResult = CONCAT(SUBSTRING(pOldVal, vPrevIndex + 1, (vIndex-vPrevIndex-1)), pDivChar, vResult);
    -- 前一个逗号的位置 = 当前逗号的位置
    SET vPrevIndex = vIndex;
    -- 查询下一个逗号的位置.
    SET vIndex = LOCATE(pDivChar,  pOldVal,  vPrevIndex + 1);  
  END WHILE;
   
  -- 最后追加最后一组数据.
  SET vResult = CONCAT(SUBSTRING(pOldVal, vPrevIndex + 1), pDivChar, vResult);
   
  -- 清除掉最后一个 逗号.
  SET vResult = LEFT(vResult, LENGTH(vResult)-1);
   
  -- 返回结果.  
  RETURN vResult;
END */$$
DELIMITER ;

